INSERT INTO `v1_a2781973aa1d64e39fe71fb121702710861fcbad375c9619bef15bda9c5a663e` VALUES (1, 1, "スタンダードコレクション", "スタンダードコレクションではポスターやペナントなど\n部屋に飾れる定番グッズが盛りだくさん！\nあなたの部屋をカルミナで彩ろう！", 3, "1回メダル{0}枚！\n定番グッズであなたの部屋をカルミナで彩ろう！");
INSERT INTO `v1_a2781973aa1d64e39fe71fb121702710861fcbad375c9619bef15bda9c5a663e` VALUES (2, 1, "プレミアムコレクション", "プレミアムコレクションではサイン色紙や\nブロマイドなど、★★以上のグッズが盛りだくさん！\nレアグッズをたくさんゲットしよう！", 10, "1回メダル{0}枚！\nメンバー直筆サイン色紙など、★★以上のグッズを確定でゲット！");
INSERT INTO `v1_a2781973aa1d64e39fe71fb121702710861fcbad375c9619bef15bda9c5a663e` VALUES (3, 1, "フェスコレクション", "フェスコレクションではカルミナサマーライブで\n大活躍するグッズが勢ぞろい！\nゲットしたグッズを片手に、いざライブ会場へ！", 3, "1回メダル{0}枚！\nカルミナライブに参加する際のマストアイテムをゲットしよう！");
